import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Link,
  Route
} from 'react-router-dom'

import Sidebar from "./Sidebar";
import Content from "./Content";

import '../styles/App.css';

function App() {
  <Router>
    <Switch>
      <Route exact={true} path='/'>
      <div className="App">
      <Sidebar />
      <Content />
    </div>
      </Route>
    </Switch>
  </Router>
}

export default App;
